ера состоялась 28 апреля 2015 г.\\r\\n\\r\\nПродолжительность спектакля 2 часа 32 мин. 18+\\r\\n\\r\\n\x22\x7d,\x7b\x22text\x22:\x22#большиегастроли\x22\x7d,\x7b\x22text\x22:\x22 \x22\x7d,\x7b\x22text\x22:\x22#спектакль\x22\x7d\x5d\x7d,\x22backstageAttachment\x22:\x7b\x22backstageImageRenderer\x22:\x7b\x22image\x22:\x7b\x22thumbnails\x22:\x5b\x7b\x22url\x22:\x22https:\/\/lh3.googleusercontent.com\/TJi4oZl6e4qNj__fHQFBP0KUepUu22KE-v0I8uG_L_bH-bGDr3NPACIkp-9EpKxmNkINQN9BISg-AQ\x3ds288-c-fcrop64\x3d1,2aab0000d554ffff-nd\x22,\x22width\x22:288,\x22height\x22:288\x7d,\x7b\x22url\x22:\x22https:\/\/lh3.googleusercontent.com\/TJi4oZl6e4qNj__fHQFBP0KUepUu22KE-v0I8uG_L_bH-bGDr3NPACIkp-9EpKxmNkINQN9BISg-AQ\x3ds400-c-fcrop64\x3d1,2aab0000d554ffff-nd\x22,\x22width\x22:400,\x22height\x22:400\x7d,\x7b\x22url\x22:\x22https:\/\/lh3.googleusercontent.com\/TJi4oZl6e4qNj__fHQFBP0KUepUu22KE-v0I8uG_L_bH-bGDr3NPACIkp-9EpKxmNkINQN9BISg-AQ\x3ds512-c-fcrop64\x3d1,2aab0000d554ffff-nd\x22,\x22width\x22:512,\x22height\x22:512\x7d,\x7b\x22url\x22:\x22https:\/\/lh3.googleusercontent.com\/TJi4oZl6e4qNj__fHQFBP0KUepUu22KE-v0I8uG_L_bH-bGDr3NPACIkp-9EpKxmNkINQN9BISg-AQ\x3ds600-c-fcrop64\x3d1,2aab0000d554ffff-nd\x22,\x22width\x22:600,\x22height\x22:600\x7d\x5d\x7d,\x22trackingParams\x22:\x22CMgDENq4ASITCMrulqu6vekCFYp2mwodtMUGGw\x3d\x3d\x22\x7d\x7d,\x22publishedTimeText\x22:\x7b\x22runs\x22:\x5b\x7b\x22text\x22:\x2221 час назад\x22,\x22navigationEndpoint\x22:\x7b\x22clickTrackingParams\x22:\x22CL0DEMShAyITCMrulqu6vekCFYp2mwodtMUGGw\x3d\x3d\x22,\x22commandMetadata\x22:\x7b\x22webCommandMetadata\x22:\x7b\x22url\x22:\x22\/post\/UgyiAubOay0_slCyC3V4AaABCQ\x22,\x22webPageType\x22:\x22WEB_PAGE_TYPE_BROWSE\x22,\x22rootVe\x22:3611\x7d\x7d,\x22browseEndpoint\x22:\x7b\x22browseId\x22:\x22UCik7MxUtSXXfT-f_78cQRfQ\x22,\x22canonicalBaseUrl\x22:\x22\/post\/UgyiAubOay0_slCyC3V4AaABCQ\x22\x7d\x7d\x7d\x5d\x7d,\x22voteCount\x22:\x7b\x22accessibility\x22:\x7b\x22accessibilityData\x22:\x7b\x22label\x22:\x22154 отметки \\\
